-33e523d6d770","type":"Circle"},"selection_glyph":null,"view":{"id":"d0e728ee-ab38-455c-a25a-c4becb3d4acf","type":"CDSView"}},"id":"458046f3-0b50-45bb-ba20-dcff07090ff7","type":"GlyphRenderer"},{"attributes":{},"id":"634c0727-52b2-4ab9-92d5-9c9edb0a90be","type":"LinearScale"},{"attributes":{},"id":"30b1cd13-91c2-450b-ab84-c754c4dc6542","type":"BasicTickFormatter"},{"attributes":{"callback":null,"tooltips":[["species","@species"],["nan_nb","@nans"],["mean_entr","@meanentropy"],["length","@lengths"],["GCcount","@gc"]]},"id":"043ba204-3d58-4d2e-a0f4-4d4d3fd27fa4","type":"HoverTool"},{"attributes":{"callback":null},"id":"e79e3ed5-e926-4465-bbd6-5b9458e7385a","type":"DataRange1d"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"value":"#1f77b4"},"line_alpha":{"value":0.1},"line_color":{"value":"#1f77b4"},"size":{"units":"screen","value":10},"x":{"field":"x"},"y":{"field":"y"}},"id":"adc8e11f-9928-47ea-82cc-33e523d6d770","type":"Circle"},{"attributes":{"args":{"source":{"id":"be44c194-c7d0-4620-ae08-1b50d9e13c41","type":"ColumnDataSource"}},"code":"\n            // JavaScript code goes here\n            console.log(\"callback-------callback\");\n            var colors = ['#f39c12', \"#1abc9c\", \"#3498db\", \"#2ecc71\", \"#9b59b6\", '#34495e', '#492000', '#960019',\n'#043927', '#8F9779', '#f1c40f', '#e67e22', '#e74c3c', '#7f8c8d'];\n            // the model that triggered the callback is cb_obj:\n            var b = cb_obj.get(\"active\");\n            var rgbToHex = function(rgb){\n              var hex = Number(rgb).toString(16);\n              if (hex.length < 2) {\n                   hex = \"0\" + hex;\n              }\n              return hex;\n            };\n            var fullColorHex = function(r,g,b) {\n                var red = rgbToHex(r);\n                var green = rgbToHex(g);\n                var blue = rgbToHex(b);\n                return \"#\"+red+green+blue;\n            };\n            // models passed as args are automagically available\n            var data = source.data;\n            var len = data.color.length;\n            var col = [];\n            var othercol = '#1abc9c';\n            if(b === 1){ //Doublon\n                var j = 0;\n                for(i=0;i<len;++i){\n                    if(data.doub[i]){\n                        col.push(colors[j]);\n                        col[i-1] = colors[j];\n                        j++;\n                    }else{col.push(\"#999999\");}\n                }\n                source.data.color = col;\n            }\n            if(b ===2){ //Nans\n                var temp = 0\n                max = Math.max(...data.nans)\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * (1 - ((data.nans[i] + 1) / 19)));\n                    col.push(fullColorHex(temp, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b === 0) { //Cluster\n                var j = 0;\n                if(data.clusters){\n                    for(i=0;i<len;++i){col.push(colors[1+data.clusters[i]]);}\n                }else{\n                    for(i=0;i<len;++i){col.push(othercol);}\n                }\n                source.data.color = col;\n            }\n            if(b === 3) { //KaKs_Scores\n                max = Math.max(...data.KaKs_Scores)\n                for(i=0;i<len;++i){\n                    // normalizing\n                    temp =  Math.floor(255 * (1 - (data.KaKs_Scores[i] / max)));\n                    col.push(fullColorHex(temp,temp,76))\n                }\n                source.data.color = col;\n            }\n            if(b === 4){ //similarity_scores\n                max = Math.max(...data.similarity_scores)\n                min = Math.min(...data.similarity_scores)\n                console.log(min)\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(255 * ((data.similarity_scores[i] - min) / (max-min)));\n                    col.push(fullColorHex(temp,temp,76))\n                }\n                data.color = col;\n            }\n            if(b === 5){ //Lengths\n                max = Math.max(...data.lengths)\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(255 * (1 - (data.lengths[i] / max)));\n                    col.push(fullColorHex(temp, temp, temp));\n                }\n                data.color = col;\n            }\n            if(b===6){ //GC\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.gc[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===7){ //ECAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.ecai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===8){ //CAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.cai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            source.change.emit();\n            "},"id":"77ff465b-fea6-480b-a415-02f15ffd4873","type":"CustomJS"},{"attributes":{"source":{"id":"be44c194-c7d0-4620-ae08-1b50d9e13c41","type":"ColumnDataSource"}},"id":"d0e728ee-ab38-455c-a25a-c4becb3d4acf","type":"CDSView"},{"attributes":{},"id":"19f0ed8b-6932-42dc-9162-9a08a8b1d323","type":"LinearScale"},{"attributes":{},"id":"4d33d7fc-4a83-47c3-a0fb-f6a9f5aace4c","type":"SaveTool"},{"attributes":{"formatter":{"id":"30b1cd13-91c2-450b-ab84-c754c4dc6542","type":"BasicTickFormatter"},"plot":{"id":"b3bb8222-b3c4-4598-a443-e01e8910f5ac","subtype":"Figure","type":"Plot"},"ticker":{"id":"b18b7f5c-853a-4cd2-9b66-85b42b9d70c0","type":"Basi
